import React from "react";
import "./Navbar.css";
import * as Unicons from "@iconscout/react-unicons";

function Navbar()
{
    return(
        <div className = "Navbar">
            <Unicons.UilCompass />
            <Unicons.UilHome />
        </div>
    );
}

export default Navbar;
